import React from 'react'
import { ParallaxBanner, withController } from 'react-scroll-parallax'
import { Typography, IconButton } from '@material-ui/core';
import {HashRouter, Link} from 'react-router-dom'
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import References from './References';

function handleLoad(props) {
    props.parallaxController.update();
}

function Home(props) {
    return (
        <>
        <div style={{
            flex: 1,
            height: 'calc(100vh - 116px)',
            justifyContent: 'center',
            alignItems: 'center',
            alignContent: 'center',
            display: 'flex',
            flexDirection: "row",
            position: "absolute",
            top: 0
        }}>
            <ParallaxBanner
                onLoad={() => handleLoad(props)}
                layers={[
                    {
                        image: require('../../ressources/img/bg.jpg'),
                        amount: 0.2,
                    },

                    /*{
                        children: (
                            <div style={{
                                marginTop: "15%",
                                marginLeft: "15%",
                                justifyContent: "center",
                                alignItems: "center",
                                width: "80%",

                            }}>
                                <Typography variant="h1">Willkommen</Typography>
                                <Typography variant="h4">Ihre Ohren werden Augen machen</Typography>
                            </div>),
                        amount: 0.6,
                        expanded: false,
                    },*/
                    {
                        children: (
                            <div style={{
                                display: 'flex',
                                width: "100%",
                                height: '100%',
                                alignItems: 'flex-end',
                                justifyContent: 'center'
                            }}>
                                <IconButton size="large">
                                    <ExpandMoreIcon fontSize="large" />

                                </IconButton>
                            </div>),
                        amount: 0,
                        expanded: false
                    }
                ]}
                style={{
                    height: 'inherit',
                }}
                expanded={false}
            />
        </div>

        </>
    )
}

export default withController(Home);
